import React, {Component} from 'react';
import './styles/App.css';

class App extends Component{
  render()
  {
    return (
        <div className="App">
         <form>
  <label>

    <input type="text" name="name" placeholder='Pick up'/>
  <br/>
     <input type="text" name="name" />
  </label>
  <input type="submit" value="Submit" />
</form>
        </div>
    );
  }
}

export default App;
